import Link from 'next/link';

const navStyle = {
  textAlign: 'center',
  marginTop: '10%',
  fontSize: '2em',
  fontFamily: '"Arial Black", Gadget, sans-serif'
};
const linkStyle = {
  margin: '50px',
  textDecoration: 'none',
};
const imgStyle = {
  height: '50%',
  textAlign: 'center',
  display: 'block',
  marginLeft: 'auto',
  marginRight: 'auto',
  width: '50%'
}
const appStyle = {
  textAlight: 'center'
}

const Header = () => (
  <div style={appStyle}>
    <img src="/dkp.png" style={imgStyle}/>
    <div style={navStyle}> 
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/events">
        <a style={linkStyle}>Events</a>
      </Link>
      <Link href="/booking">
        <a style={linkStyle}>Booking</a>
      </Link>
    </div>
  </div>
);

export default Header;
